description:
Reasonable Doubt is the debut album of American rapper Jay-Z, released on June 25, 1996, by Roc-A-Fella Records and Priority Records. It features production by DJ Premier, Ski, Knobody and Clark Kent, and guest appearances from Memphis Bleek, Mary J. Blige, and The Notorious B.I.G., among others. Reasonable Doubt features Mafioso rap themes and gritty lyrics about the &quot;hustler&quot; lifestyle and material obsessions.

